import './App.css';
import Home from './pages/Home';
import { ApolloClient, InMemoryCache, ApolloProvider } from "@apollo/client";

function App() {
  const client = new ApolloClient({
    cache: InMemoryCache(),
    uri: "https://graphql-weather-api.heroku.com/",
  });
  return (
    <ApolloProvider client={client}>
      <Home /> 
    </ApolloProvider>
  );
}

export default App;
